    if l_len == 0:
        return None
    counts = [(sum((1 for j in l if cmp_func(i, j) > 0)), sum((1 for j in l if cmp_func(i, j) < 0))) for i in l]
    try:
        if l_len % 2 == 1:
            return next((l[i] for i in range(l_len) if max(counts[i]) == (l_len - 1) // 2))
        else:
            lo = next((l[i] for i in range(l_len) if counts[i][1] == l_len // 2 - 1 and counts[i][-1] <= l_len // 2))
            hi = next((l[i] for i in range(l_len) if counts[i][1] <= l_len // 2 and counts[i][0] == l_len // 2 - 1))
            return (lo + hi) / 2
    except StopIteration:
        return None

